import React from "react";
import { PathRouteProps } from 'react-router-dom'

interface NamedPathRouteProps extends PathRouteProps {
  name: string;
}

export const routesConf: NamedPathRouteProps[] = [
  {
    path: 'host',
    name: '主机',
    children: React.lazy(() => import('../pages/hosts'))
  },
  {
    path: 'ssh',
    name: 'SSH',
    children: React.lazy(() => import('../pages/ssh'))
  },
  {
    path: 'scp',
    name: 'SCP',
    children: React.lazy(() => import('../pages/scp'))
  },
  {
    path: 'recent',
    name: '最近使用',
    children: React.lazy(() => import('../pages/recent'))
  },
]
